Blues Summit album by BB King was released Jun 22, 1993 on the MCA (USA) label. Principally recorded at Ardent Studios, Memphis, Tennessee from February 15-19, 1993 and Fantasy Studios, Berkeley, California from March 8-12, 1993. Blues Summit songs Contains liner notes by Andy McKaie. BLUES SUMMIT, a series of duets with a who's who of the blues, is classic B.B. King, probably his finest album of the 1990s. And if BLUES SUMMIT proves anything, it's that B.B. King is still hard, still a leader, still capable of raising the hairs on the back of your neck as he grooves into his sixth decade of preaching the blues.B.B. King isn't merely a blues innovator, he's a student of the music, an avid collector of blues, R&amp;B and jazz recordings. Blues Summit CD music contains a single disc with 12 songs.  Kinda felt the need for the Blues. If you seed this at least you know where to find it Enjoy
